import React from 'react';
import s from './Dialogs.module.css';
import {NavLink} from "react-router-dom";

const DialogItem = (props) => {
    return (
        <div className={s.dialog}>
            <NavLink to={"/dialogs/" + props.id}>{props.name}</NavLink>
        </div>
    )
}


const Dialogs = (props) => {
    return (
        <div className={s.dialogs}>
            <div className={s.dialogItems}>
                <div className={s.dialog + " " +s.active}>
                    <NavLink to="/dialogs/1">Dima</NavLink>
                </div>
                <div className={s.dialog}>
                    <NavLink to="/dialogs/2">Svetlana</NavLink>
                </div>
                <div className={s.dialog}>
                    <NavLink to="/dialogs/3">Angelika</NavLink>
                </div>
                <div className={s.dialog}>
                    <NavLink to="/dialogs/4">Max</NavLink>
                </div>
                <div className={s.dialog}>
                    <NavLink to="/dialogs/5">Aneta</NavLink>
                </div>
                <div className={s.dialog}>
                    <NavLink to="/dialogs/6">Pasha</NavLink>
                </div>
            </div>
            <div className={s.messages}>
                <div className={s.message}>Hi</div>
                <div className={s.message}>How is your day?</div>
                <div className={s.message}>You</div>
            </div>
        </div>
    )
};

export default Dialogs;
